var b="url",c="센터장.html",d="generationDate",e=new Date(1718327232336.47),f="defaultAdaptiveView",g="name",h="Base",i="size",j="width",k=1440,l="height",m=0,n="adaptiveViews",o="sketchKeys",p="",q="s0",r="variables",s="OnLoadVariable",t="page",u="packageId",v="874cc14b9dcc42a3ac22ffad308e29cb",w="type",x="Axure:Page",y="센터장",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="f9a4487501ae467fb85d8cdd7cff5083",F="label",G="(Rectangle)",H="Note",I="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">대시보드 화면</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 직영일 경우에만 대시보드 활성화(가맹은 기존 메인화면 동일)</span></p><p><span style=\"font-family:'Noto Sans KR';\">- [</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">타임넷 전광판] &gt; [익힘관리] 내 조회 항목에서 조회되는 센터 기준으로 </span><span style=\"font-family:'Noto Sans KR';\">대시보드 조회 되는&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">화면이 달리 구현 됨</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 엠스위치 교육기관이 타임넷 익힘관리 교육기관에 있을 경우: 모든 항목 조회 </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 엠스위치 교육기관이 타임넷 익힘관리 교육기관에 없을 경우:</span><span style=\"font-family:'Noto Sans KR';\"> 성적 항목의 4건 숨김처리, 나머지는 조회 가능</span></p>",J="2",K="9c8a3e60accc499bae24ae8566367b9c",L="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">그룹/교육기관</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 조회 정보: 회원 권한별로 조회 조건 다름</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 본부장, 사업부장, 센터장: 조회정보는 아이디에 부여 된 모든 교육기관 소속 정보 일괄 조회(그룹/교육기관 변경해도 동일한 데이터 조회)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 시스템관리자: </span><span style=\"font-family:'Noto Sans KR';\">조회 정보는 선택 한 교육기관 소속 정보</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\"> 조회(그룹/교육기관 변경 시 각 교육기관별 데이터만 조회)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; *&nbsp; 나머지 권한: 대시보드 화면 접근불가(기존 메인화면으로 랜딩)</span></p>",M="3",N="66e0779f11ff459eb0705c07f77e697b",O="검색",P="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">검색기능 제공</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 클릭 시, 검색 기능 레이어 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 검색정보 클릭 시, 해당 메뉴 팝업 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 옵션 내 필터링 제공</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2.0에 개발 예정</span></p>",Q="4",R="16aa9b984cf745d49b92648fe27370fc",S="(Text Field)",T="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">최상단 영역</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 공지사항 배너</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 기존 사용하던 배너 그대로 사용</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 환영 문구: 타이핑 인터렉션</span></p><p><span style=\"font-family:'Noto Sans KR';\">아래 문구 랜덤 노출</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘 하루도 반가워요. 😄</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘 하루도 기분 좋은 시작을 해보아요. 😄</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 방문해주셔서 환영해요! 😍</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 오늘도 행복 가득한 하루 되세요! 🍀</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘도 함께해 줘서 고마워요. 👍</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 방문해주셔서 너무 기뻐요! 🥳</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘도 보게 되어서 정말 좋아요. 🌟</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님, 언제나 당신을 여기서 기다리고 있어요. 💖</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 오늘은 뭐 하실 계획이세요? 🤔</span></p><p><span style=\"font-family:'Noto Sans KR';\">OOO님! 대시보드를 통해 다양한 정보를 활용해보시길 바래요. 😃</span></p><p><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">※ 개발공수가 클 경우, </span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">추후 v2.0에 개발 예정</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">3) 입력 문구: </span></p><p><span style=\"font-family:'Noto Sans KR';\">- textField이며, 수정버튼(연필) 클릭 시 수정 가능</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 수정 시에는, 취소버튼(X), 확인버튼(✔️) 활성화/수정버튼(연필) 비활성화</span></p><p><span style=\"font-family:'Noto Sans KR';\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';\">4) 금일 날짜 표기</span></p><p><span style=\"font-family:'Noto Sans KR';\">- YYYY. MM. DD(DAY)</span></p>",U="5",V="8dcc7f8cf07b4bc88d912ec589912439",W="위젯 설정",X="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">위젯 설정</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 클릭 시, 위젯 설정 관련 레이어 팝업 활성</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 위젯별로 추가/삭제/활성화 토글 처리 </span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; ㄴ 본사 지정 위젯은 토글 변경 불가 처리</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2.0에 개발 예정</span></p>",Y="6",Z="5705363edc794887b734b588efe6e411",ba="🏆 현재 소속된 전체 교육기관의 1",bb="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">교육기관 평균 인원</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 사용자가 소속한 교육기관의 전체 반의 평균(avg) 인원 수</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 인원: 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 당해년도, 전월 말일 기준</span></p>",bc="7",bd="2f7cade2e6204b009a389e02cb85249d",be="목표 매출 달성률",bf="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">목표 매출 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용(ex. 교육기관2/합계 선택 시 확인 가능)</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bg="7.1",bh="5aa3330567d048b6ae8b7fbefe7f5bd0",bi="교육기관1",bj="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">그리드 정보</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 교육기관 선택 시, 교육기관 월별자료를 조회</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 디폴트: 모든 교육기관 총 합계 데이터</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 교육기관 선택: 긱 교육기관 월별자료 조회</span></p>",bk="8",bl="d4684f6c3f4447e5be4dc75b959cd75d",bm="목표 학생수 달성률",bn="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">목표 학생수 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도/월 마감 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 산업율/퇴원율: 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bo="8.1",bp="b1f53208ca6e4ab18298adad67384469",bq="9",br="08439cb2a79a4bdfb036ba79086eed20",bs="성적",bt="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">성적</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 미탐 표준레벨 지수</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 표준등급 인원 비율</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 응시현황</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">4) 회독수별 성취현황</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\"><br></span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">※ 공통사항</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 1), 2), 3), 4) : 모든 데이터는 전일자 기준 누적으로 조회</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 1), 2) : 수학 교과목에 한함</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 3), 4) : 과정: 엠테스트 내 &quot;시험학년/학기&quot;에 대한 정보를 기반으로 명칭 재정의</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp; * 예시) (엠테스트) 중1 / 1학기 → 중1-1</span></p>",bu="9.1",bv="e65eba80f1a4430d9764d058b71e3bc2",bw="(Dynamic Panel)",bx="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">미탐 표준레벨 지수</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 레벨현황에 학년, 응시과정, 성취수준 표기</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; : 학년-과정(시험학년.학기)성취수준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; (1) 학년, 과정</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &#149; 초등과정 표기: 초1~6:&nbsp; 1~6</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &#149; 중/고등과정 표기: 중1~고1:&nbsp; 7~10</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; (2) 성취수준</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &#149; P&nbsp; &nbsp; &nbsp; &nbsp; MP, M1 등급</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &#149; A&nbsp; &nbsp; &nbsp; &nbsp; M2, M3 등급</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &#149; B&nbsp; &nbsp; &nbsp; &nbsp; M4, M5 등급</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &#149; C&nbsp; &nbsp; &nbsp; &nbsp; N 등급</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 교육기관 내 성취수준 지표가 잡히는 정보 한하여 조회<br>&nbsp;&nbsp; * 성취수준 지표 정보<br>　(정보 내 0 또는 null 값은 제외)<br>&nbsp;&nbsp; - </span><span style=\"font-family:'Noto Sans KR';font-weight:700;\">신입</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">일 경우, 인증평가 C에 해당되는 정보만 노출되며, 숫자가 높은 순 3건, 숫자가 낮은 순 3건 노출(정보 내 0 또는 null 값은 제외)<br>&nbsp;&nbsp; - </span><span style=\"font-family:'Noto Sans KR';font-weight:700;\">재원, 퇴원</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">일 경우, 인증평가 A, B만 노출되며, 숫자가 높은 순 3건, 숫자가 낮은 순 3건 노출</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; → 조회항목에 걸리는 모든 컬럼의 정보는 전체 노출되며, 순번은 상기 미탐 표준레벨 가이드 준수(낮은순-높은순)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; → 동일 값을 가질 경우, 중복값 허용하여 높은 수치/낮은 수치 3개씩만 표현</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 성취수준 숫자는 누적임(Headcount 아님)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp;&nbsp; : 성취수준 648건(별도 엑셀 파일 확인요)<br>4) 재원상태 신입 기준: 등록 후, 1개월에 한하는 인원</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">5) 평가항목은 입학평가를 제외함</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">6) 교과목은 수학에 한함</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">7) 전일자 기준 누적</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">8) 표준레벨 지수 확인 방법 툴팁추가</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">9) 기존 신입~퇴원 툴팁 중 예비 항목 삭제</span></p>",by="9.2",bz="5c848152b3684b3e8cf647eba8e690c8",bA="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">표준등급 인원 비율</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 교육기관 조회 조건에 따라 우측 그래프 정보 조회<br>2) 응시자는 누적: 교육기관의 시험에 대해 회독별 인원수 누적으로 합산 </span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">→ 같은 인원이 1회독, 2회독 하더라도 응시자는 2명으로 환산(Datahub 내 n회독 인원 수 정보와 동일)</span><span style=\"font-family:'Noto Sans KR';font-weight:400;\"><br>3) 기대등급에 만족: n회독별 기대등급 사항에 포함되어야 함<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#D7D7D7;\">&nbsp;&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">* 1회독: 만족(M3,M4,M5) / 초과(MP,M1,M2) / 미만(N)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#D7D7D7;\">&nbsp;&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">* 2회독: 만족(M2,M3,M4) / 초과(MP,M1) / 미만(M5,N)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#D7D7D7;\">&nbsp;&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">* 3회독: 만족(M1,M2,M3) / 초과(MP) / 미만(M4,M5,N)</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#D7D7D7;\">&nbsp;&nbsp; </span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">* 4회독: 만족(M1,M2,M3) / 초과(MP) / 미만(M4,M5,N)<br>4) 기대등급 초과: n회독보다 등급이 높은 경우</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">5) 기대등급 미만: n회독보다 등급이 낮은 경우<br>6) 교과목은 수학에 한함</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">7) 전일자 기준 누적</span></p>",bB="9.2.1",bC="9601a15cce2145f59ebeb8705395a2e5",bD="기대등급",bE="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">표준등급 인원 비율 - 기대등급 명시</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 표준등급(%): 응시자의 표준점수 값</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 등급상위(%): (기대등급 초과 / 응시자) * 100</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 등급하위(%): (기대등급 미만 / 응시자) * 100</span></p>",bF="9.2.2",bG="59953c8a05784b07ac5cdf87c41f193f",bH="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">표준등급 인원 비율 - 그래프</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 표준등급(%): 기대등급 만족 / 응시자</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 등급상위(%): 기대등급 초과 / 응시자</span></p><p><span style=\"font-family:'Noto Sans KR';\">3) 등급하위(%): 기대등급 미만 / 응시자</span></p>",bI="9.3",bJ="d44668e40fb64ff39dc4a97fa93b8288",bK="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">회독수별 성취현황</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 교육기관 내 과정 지표가 잡히는 정보에 한하여 조회<br>&nbsp;&nbsp; [과정이 조회되면 등급은 P~N까지 전체 조회]</span><span style=\"font-family:'Noto Sans KR';font-weight:700;\"><br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 과정: 엠테스트 내 &quot;시험학년/학기&quot;에 대한 정보를 기반으로 명칭 재정의<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">&nbsp;&nbsp; * 예시) (엠테스트) 중1 / 1학기 → 중1-1</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">※ 회독: 인원수-과정으로 묶인 모든 인원수(Datahub 그대로) / 평균-과정으로 묶인 모든 시험들의 평균 점수(소수 둘째자리)</span></p>",bL="9.4",bM="7b2cb405a6454abea71a8813db8644a2",bN="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">응시현황<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;\">1) 기존과 동일</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">2) 소계 위치 변경</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">&nbsp;&nbsp; * 기존: 하단 / 변경: 상단</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">3) 시험명 좌측 내 &quot;과정&quot; 항목 추가</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">4) 과정: 엠테스트 내 &quot;시험학년/학기&quot;에 대한 정보를 기반으로 명칭 재정의<br></span><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">&nbsp;&nbsp; * 예시) (엠테스트) 중1 / 1학기 → 중1-1</span></p>",bO="10",bP="6a86be8c0d5949c7acf8094f6413055c",bQ="익힘관리 달성률",bR="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">익힘관리 달성률</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 오답노트 / 2) 숙제</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (1) 교육기관별 응시현황: 전체 교육기관 수</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (2) 이용률 높은 선생님: 전체 교육기관 중 건수 높은 5개 순</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * (3) 이용률 낮은 선생님: 전체 교육기관 중 건수 낮은 5개 순</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 인원수는 0 표기<br><br>* 학생 1인당 평균&nbsp; = 건수 / 학생 수(교육기관별 선생님마다 부여 된 학생 수) </span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 당해년도 기준</span></p>",bS="11",bT="8700b57d71bd42ab845b46d231cf3637",bU="신규 상담 건수 및 전환율",bV="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">신규 상담 건수 및 전환율</span></p><p><span style=\"font-family:'Noto Sans KR';\">1) 교육기관별: 당해년도 기준</span></p><p><span style=\"font-family:'Noto Sans KR';\">2) 월별 합계: 당해년도 기준 상담 데이터(헤드 카운트[중복제외])</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 교육기관 선택 시, 월별 합계 앞에 교육기관 표기 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 목표달성률/전년비: </span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 첫째자리 실수이며, 둘째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 100%미만 일경우 </span><span style=\"font-family:'Noto Sans KR';color:#0000FF;\">파란색</span><span style=\"font-family:'Noto Sans KR';\">/100%이상일 경우 </span><span style=\"font-family:'Noto Sans KR';color:#D9001B;\">빨간색</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",bW="11.1",bX="51692ce56c1a44eabf1c88a0272640e1",bY="12",bZ="0273c8053a0d47e8907d09adb812abad",ca="DB확보",cb="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">DB 확보</span></p><p><span style=\"font-family:'Noto Sans KR';\">- 비율: 실수이며, 첫째자리 반올림 적용</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 회원비율: 전체 회원에서 회원수 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 비율1: 전체 회원에서 휴대폰연락처(유) 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">&nbsp;&nbsp; * 비율2: 전체 회원에서 마케팅동의 비율 차</span></p><p><span style=\"font-family:'Noto Sans KR';\">※ 데이터 null 값이면 &quot;-&quot; 표기(기호 포함X)</span></p>",cc="13",cd="5c59535d4b6d46b2ad4fd037912366b1",ce="<p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">타임넷 전광판 화면 레이아웃과 동일수준으로 수정 적용</span></p>",cf="14",cg="10bc37570fbf4d3197ab87cc0ca06494",ch="(Image)",ci="<p><span style=\"font-family:'Noto Sans KR';font-weight:700;\">대시보드 스위치 버튼</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;\">- 원장권한 뿐만 아니라, 직원, 강사 화면 선택하여, 대시보드 변경 가능토록 기능 개선</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">※ 추후 v2 이후 개발 사항입니다.</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">회원권한에 따라 보이는 스위칭 버튼 정의</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 센터장 - 센터장, 상담사, 강사</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 상담사 - 상담사</span></p><p><span style=\"font-family:'Noto Sans KR';font-weight:400;color:#0000FF;\">* 강사 - 강사</span></p>",cj="style",ck="baseStyle",cl="627587b6038d43cca051c114ac41ad32",cm="pageAlignment",cn="center",co="fill",cp="fillType",cq="solid",cr="color",cs=0xFFFFFFFF,ct="image",cu="imageAlignment",cv="near",cw="imageRepeat",cx="auto",cy="favicon",cz="sketchFactor",cA="0",cB="colorStyle",cC="appliedColor",cD="fontName",cE="Applied Font",cF="borderWidth",cG="borderVisibility",cH="all",cI="borderFill",cJ=0xFF797979,cK="cornerRadius",cL="cornerVisibility",cM="outerShadow",cN="on",cO=false,cP="offsetX",cQ=5,cR